import Login from "./Pages/Login";
import Register from "./Pages/Register";
import Dashboard from "./Pages/User/Dashboard"

var routes = [
    { path: "/", name: window.location.pathname, component: Login, layout: "/" },
    { path: "/login", icon: "fa fa-home", name: "Login", component: Login, layout: "/auth" },
    { path: "/register", icon: "fa fa-home", name: "Register", component: Register, layout: "/auth" },
    { path: "/register", icon: "fa fa-home", name: "Register", component: Dashboard, layout: "/auth" },
    
];
export default routes;
